import React from 'react'
import County from './County'

const Counties = ({ budgets, onDelete, onToggle }) => {
  return (
    <>
      {budgets.map((budget, index) => (
        <County key={index} budget={budget} onDelete={onDelete} onToggle={onToggle} />
      ))}
    </>
  )
}

export default Counties
